import React from "react";
import "./index.css"


const Home = () => {
    return (
        <>
            <section id="header" className="bg_img">
                
                            <div className="col-md-6 pt-5 pt-lg-0 order-2 order-lg-1">
                                <h1>Hii this is My first web page</h1>
                                <h2 className="my-3"> I am tring to create website and this webside is demo web</h2>
                                <div className="mt-3">
                                    <a href="/" className="btn btn-sm btn-primary">Get start your website</a>
                                </div>
                            </div>

                     
            </section>
        </>
    )
}
export default Home;
